const Button = (props) => {

    return (
      <div>
        <div>
          {props.state === 0 ? (
            <button onClick={props.start}>Start</button>
          ) : (
            ""
          )}
        </div>

        <div>
          {props.state === 1 ? <button onClick={props.stop}>Stop</button> : ""}
        </div>

        <div>{props.state === 2 ? (
          <div>
            <button onClick={props.reset}>Reset</button>
          </div>
        ) : (
          ""
        )}</div>

      </div>
    );
}

export default Button;
